const xdown: any = (x: any,y: any)=>{
let reg: any =/[\u4e00-\u9fa5]/g;
  x = x[0].homeName.replace(reg, "");
  y = y[0].homeName.replace(reg, "");
  return (Number(x) < Number(y))? 1 : -1;
}


// 按房间名称搜索
export const getHouse = (page: any,size: any,search: any)=>{
  let xarr: any = [];
  let xobj: any = {};
  let dl: any = []; //顶楼
  let wy: any = []; //物业
  let hs: any = []; //会所
  let fm: any = []; //峰明置业
  let lc: any = []; //楼层
  let xdata: any = [];
  let reg: any =/[\u4e00-\u9fa5]/g;

  dataJson.forEach((item: any)  => {
    if(xobj[item.homeName] === undefined) {
      xobj[item.homeName] = xarr.length
        xarr.push([item])
    } else {
      xarr[xobj[item.homeName]].push(item)
    }
  });
  for(let i: any=0; i<xarr.length; i++){
    if(xarr[i][0].homeName == '会所'){
      hs.push(xarr[i])
    }
    if(xarr[i][0].homeName == '顶楼'){
      dl.push(xarr[i])
    }
    if(xarr[i][0].homeName == '物业服务中心'){
      wy.push(xarr[i])
    }
    if(xarr[i][0].homeName == '物业服务中心'){
      wy.push(xarr[i])
    }
    if(xarr[i][0].homeName == '峰明置业'){
      fm.push(xarr[i])
    }
    if(xarr[i][0].homeName !== '会所' && xarr[i][0].homeName!== '物业服务中心' && xarr[i][0].homeName !== '顶楼' && xarr[i][0].homeName !== '峰明置业'){
      lc.push(xarr[i]);
    }
  }
  lc = lc.sort(xdown); //按楼层排序

  if(Number(search)){
    lc.map((itme: any,index: any)=>{
      let homename: any = itme[0].homeName.replace(reg, "");
      console.log('1111',homename,(Number(search)+1)*100);
      if(Number(homename) < ((Number(search)+1)*100) && Number(homename) >= ((Number(search))*100)){
        xdata.push(lc[index]);
      }
    })
    if(search=='1'){
      xdata.push(...dl);
      xdata.push(...hs);
      xdata.push(...wy);
      xdata.push(...fm);
    }
    return {data:pagination(page,size,xdata),total:xdata.length}
  }
  // 不传搜索值
  lc.push(...dl);
  lc.push(...hs);
  lc.push(...wy);
  lc.push(...fm);
  return {data:pagination(page,size,lc),total:lc.length}

}

